import React, { useState } from 'react';
import { Link, NavLink } from 'react-router-dom';

const menu = [
	{
		id: 1,
		name: 'home'
	},
	{
		id: 2,
		name: 'about',
		children: [
			{
		 		id: 8,
				name: 'about'
			},
			{
		 		id: 9,
				name: 'team'
			},
			{
		 		id: 10,
				name: 'other',
				children: [
					{
						id: 11,
 						name: 'link 1'
					},
					{
						id: 12,
 						name: 'link 2'
					},
					{
						id: 13,
 						name: 'link 3'
					}
				]
			}
		]
	},
	{
		id: 3,
		name: 'blog'
	},
	{
		id: 4,
		name: 'contact'
	},
	{
		id: 5,
		name: 'services'
	},
	{
		id: 6,
		name: 'pricing'
	},
	{
		id: 7,
		name: 'portfolio'
	}
];

function Navbar() {
	const [toggle, setToggle] = useState(false);
  const handleToggle = () => setToggle(!toggle);

  const [dropdown, setDropdown] = useState(false);
  const handleDropdown = () => setDropdown(!dropdown);

	return (
		<nav id="navbar" className={!toggle ? "navbar" : "navbar navbar-mobile"}>
			<ul>
				{
					menu.map(m => {
						console.log(m.children);
						if(m.children) {
							m.children.map(mc => { return (
								<li key={mc.id} className="dropdown">
									<NavLink to={mc.name}>
										<span>{mc.name}</span>
										<i className="bi bi-chevron-down"></i>
									</NavLink>
								</li>
							)})
						}
   	 				return (
							<li key={m.id}>
								<NavLink to={m.name}>{`${m.name[0].toUpperCase()+m.name.slice(1)}`}</NavLink>
							</li>
	 	 		  	)})
				}
			</ul>
			{!toggle ? (<i onClick={handleToggle} className="bi mobile-nav-toggle bi-list"></i>) : (<i onClick={handleToggle} className="bi mobile-nav-toggle bi-x"></i>)}
		</nav>
	)
}

function Header() {
	return (
  	<header id="header" className="fixed-top d-flex align-items-center">
			<div className="container d-flex align-items-center justify-content-between">
				<div className="logo">
					<h1 className="text-light"><NavLink to="/" className={({ isActive, isPending }) =>
    isPending ? "pending" : isActive ? "active" : ""
  }>Serenity</NavLink></h1>
					{/*<Link to="/">
						<img src="../assets/img/logo.png" alt="" className="img-fluid" />
					</Link>*/}
				</div>
				<Navbar />
			</div>
		</header>
	)
}

export default Header;

